import React, { useState } from "react";

const SortForm = ({ onSort }) => {
  // Використовуємо стан для полів форми
  const [launchMax, setLaunchMax] = useState("");
  const [launchMin, setLaunchMin] = useState("");
  const [country, setCountry] = useState("");
  const [manufacturer, setManufacturer] = useState("");
  const [sortOrder, setSortOrder] = useState("");

  // Обробник кнопки сортування
  const handleSort = () => {
    // Підготовка параметрів сортування
    const sortParams = {
      launchMax: launchMax !== "" ? launchMax : undefined,
      launchMin: launchMin !== "" ? launchMin : undefined,
      country: country !== "" ? country : undefined,
      manufacturer: manufacturer !== "" ? manufacturer : undefined,
      order: sortOrder !== "" ? sortOrder : undefined,
    };

    // Викликаємо функцію сортування з параметрами
    onSort(sortParams);
  };

  // Обробник для скидання полів форми
  const handleClear = () => {
    setLaunchMax("");
    setLaunchMin("");
    setCountry("");
    setManufacturer("");
    setSortOrder("");
    // Очищуємо сортування і завантажуємо всі ракети знову
    onSort({});
  };

  return (
    <div className="col-md-4 ms-auto">
      <div className="form">
        <form id="search__form" className="rocket__sort__form mb-4">
          <h2 className="mb-3 text-light">Sort rocket</h2>

          <div className="mb-2">
            <label htmlFor="launch-max" className="form-label text-light">
              Launch max
            </label>
            <input
              type="text"
              className="form-control form-control-sm"
              id="launch-max"
              value={launchMax}
              onChange={(e) => setLaunchMax(e.target.value)}
            />
          </div>

          <div className="mb-2">
            <label htmlFor="launch-min" className="form-label text-light">
              Launch min
            </label>
            <input
              type="text"
              className="form-control form-control-sm"
              id="launch-min"
              value={launchMin}
              onChange={(e) => setLaunchMin(e.target.value)}
            />
          </div>

          <div className="mb-2">
            <label htmlFor="country-select" className="form-label text-light">
              Country
            </label>
            <select
              id="country-select"
              className="form-select form-select-sm"
              value={country}
              onChange={(e) => setCountry(e.target.value)}
            >
              <option value="">Select a country</option>
              <option value="USA">USA</option>
              <option value="EU">EU</option>
              <option value="Ukraine">Ukraine</option>
            </select>
          </div>

          <div className="mb-2">
            <label
              htmlFor="manufacturer-select"
              className="form-label text-light"
            >
              Manufacturer
            </label>
            <select
              id="manufacturer-select"
              className="form-select form-select-sm"
              value={manufacturer}
              onChange={(e) => setManufacturer(e.target.value)}
            >
              <option value="">Select a manufacturer</option>
              <option value="SpaceX">SpaceX</option>
              <option value="ULA">ULA</option>
              <option value="Airbus Space">Airbus Space</option>
              <option value="Pivdenne">Pivdenne</option>
              <option value="Boeing">Boeing</option>
            </select>
          </div>

          <div className="mb-2">
            <label
              htmlFor="sort-order-select"
              className="form-label text-light"
            >
              Sort by number of launches
            </label>
            <select
              id="sort-order-select"
              className="form-select form-select-sm"
              value={sortOrder}
              onChange={(e) => setSortOrder(e.target.value)}
            >
              <option value="">No sorting</option>
              <option value="asc">From smallest to largest</option>
              <option value="desc">From largest to smallest</option>
            </select>
          </div>

          <button
            id="sort__button"
            type="button"
            className="btn btn-light btn-sm"
            onClick={handleSort} // Обробка натискання кнопки сортування
          >
            Sort
          </button>
          <button
            id="clear__sort__button"
            type="button"
            className="btn btn-danger btn-sm"
            onClick={handleClear} // Очищення полів форми
          >
            Clear
          </button>
        </form>
      </div>
    </div>
  );
};

export default SortForm;
